  description: '- Boil potatoes in salted water in a pressure cooker for 3-4 whistles over medium flame or until soft. Transfer boiled potatoes to a colander to drain excess water. Peel the potatoes and transfer them to a large bowl.\n\n - Add 1/3 cup finely chopped onion(1 medium), 1/4 cup(4 tablespoons) finely chopped coriander leaves, 1 finely chopped green chilli, red chilli powder, 1 teaspoon cumin-coriander powder and 1/2 teaspoon dry mango powder(amchur powder) (or 1/2 teaspoon lemon juice). Add salt only if you have not added while oiling the potatoes OR just taste the boiled potatoes for salt and add more if required and mix well.\n\n - Take the bread and take 1/2 cup water in a wide bowl or a plate. Take one slice and lightly dip it in the water for a second and quickly remove it.\n\n - Now squeeze off the excess water by gently pressing the slice between your palms, remove as much water as possible without breaking the bread slice.\n\n - Now take a small portion of stuffing mixture and place it in the center lengthwise diagonally. Make sure that the stuffing is covered well from all the sides.Deep fry them until golden brown and crispy.'
