  description: '- Boil 2 medium potatoes and 1/2 cup sweet corn until soft. Peel the boiled potatoes and grate them or mash them and transfer to a large bowl.Add boiled sweet corns. Add 3/4 cup grated Cheese (mozzarella or processed).\n\n - Add 4 tablespoons finely chopped coriander leaves, 1/2 teaspoon grated ginger, 1 finely chopped green chilli, 1/2 teaspoon chaat masala powder, 1/4 teaspoon black pepper powder, 2 tablespoons breadcrumbs (or more as needed) and salt.\n\n - Take a medium bowl and add 2 tablespoons cornstarch (white corn flour) and 2 tablespoons maida (all purpose flour) to it. Add water(approx. 1/4 cup) little by little as needed and mix well to make a medium thick paste. Take 1/2 cup dry breadcrumbs in a plate or a bowl. Take each ball one by one and roll it in the breadcrumbs.\n\n -Take one ball and dip it into the cornstarch-maida paste. Make sure that the ball is coated evenly from all the sides. Remove the ball carefully (either using a spoon or your fingers) and roll it in bread crumbs. \n\n - Deep fry them until golden brown and crispy.'
