  description: '- Grind 1/2 teaspoon ginger, 1/2 teaspoon garlic and 1 green chilli together in the small jar of a grinder until a medium coarse paste. \n\n - Add 1 cup besan(gram flour).Add 1 tablespoon sesame seeds, 2 tablespoons roasted peanuts powder, 1/2 teaspoon red chilli powder, 1 teaspoon cumin-coriander powder, 1/4 teaspoon turmeric powder, 1/8 teaspoon baking soda and salt. \n\n - Add ginger-garlic-chilli paste, Add little water at a time (up to 1/4 cup, or more or less as needed, used 1/4 cup + 1 tablespoon) as needed and mix well to make thick batter (or dough, add less water to make dough or more water to make the batter). \n\n - Add little water at a time (up to 1/4 cup, or more or less as needed, used 1/4 cup + 1 tablespoon) as needed and mix well to make thick batter. \n\n - Pour 1-2 glasses of water in a steamer or a broad and deep vessel and heat it over medium flame. Place a stand in the steamer. Grease a tray with oil and place it over the stand. Spread the batter in the greased tray. Cover it with a lid and steam it for 15-20 minutes over medium flame.\n\n - After 15 minutes, remove the lid and check it by inserting a toothpick or a knife in the center and if it comes out clean then it is cooked. If it is not, then steam cook it for another 5 minutes. \n\n - Heat 3-4 tablespoons oil in a non-stick pan over medium flame. Place 7-8 pieces (or more depending on the size of a pan) in a pan and shallow fry them until bottom surface turns light golden brown.'
