  ingredients: [[3],[26],[29],[33],[2],[9],[10],[38],[8],[31],[11],[28],[32]],
  description: '- Make a paste of green chilli, ginger and garlic using mortar and pestle or in the small chutney jar of a mixer grinder. Peel boiled potatoes and mash them with backside of a large spoon. \n\n - Heat 2-teaspoons oil in a small pan over medium flame. Add mustard seeds. When they start to crackle, add asafoetida, curry leaves and a paste of green chilli-ginger-garlic. Stir and cook for a minute. Add turmeric powder and mix well. \n\n - Add chopped coriander leaves, lemon juice and salt. Divide it into 9-10 equal portions. If mixture turns sticky, grease your hands with oil and make round shaped balls from it. \n\n - Prepare batter for vada – take gram flour, baking soda and salt in a wide mouthed bowl. Add water (approx. 1/3 cup) little by little and stir continuously and make a lump free smooth batter. Consistency of the batter should be slightly thinner than dosa batter. \n\n - Heat oil in a pan over medium flame for deep-frying. When oil is medium hot, dip each potato ball into batter and coat it evenly with hand or spoon and gently drop it into the hot oil. Drop 3-4 balls in a single batch and deep-fry them until light golden brown. \n\n - Take pav and slit it horizontally into two equal halves and keep one-side connected. Spread 1-tablespoon green chutney on both inner sides of pav bun. Spread 1/2 tablespoon dry garlic chutney over it. \n\n - Place one fried batata vada between them. Vada Pav is ready. Serve it with fried green chilli, green chutney and tomato ketch up.'
