  photosArray:['data:image/jpeg;base64,'],
  ingredients: [[49],[6],[0],[15],[9],[38],[50],[8]],
  description: '- Take 1 cup urad dal in a small deep pot. Wash it 2-3 times in water and then soak it in approx. 1½ cups water for 2-3 hours. Don’t soak it for more than 3 hours. If possible, use whole skinned urad dal instead of split urad dal. \n\n - Drain excess water from the dal and transfer it to the jar of a blender/mixer grinder. Grind until the batter is fluffy and have smooth texture. Sprinkle few drops of cold water while grinding to grind it smoothly. Don’t add too much water while grinding (added less than 1/2 cup water). While grinding, scrap the sides with a spatula and sprinkle water as needed to grind it smoothly. Batter should be thick in consistency. \n\n - Transfer batter into a bowl and beat it using your hand for 1-2 minutes in one direction. This process incorporates air which makes the vada light and fluffy. To check the batter is fluffy enough or not, drop a small portion of batter in the bowl filled with water and if it floats on the surface it means that batter is fluffy enough. \n\n - Add 1 finely chopped onion (optional), 1 teaspoon cumin seeds, 1/2 teaspoon crushed black peppercorns, 5-7 chopped curry leaves, 1-2 chopped green chillies, a pinch of asafetida (hing), 2-3 tablespoons chopped coriander leaves and salt. \n\n - Heat oil in a deep kadai or frying pan over medium flame. Wet your palm with water. Take medium lemon sized portion of batter on your palm, press it gently and make thick round shaped vada. \n\n - Make a whole in the center using your thumb. When the oil is medium hot, slowly slide vada in it; add 3-4 vadas at a time. Flip and deep-fry both the sides until they turn light golden brown and crisp. '
