  description: '- Heat 2 teaspoons oil in a pan or kadai over medium flame. Add 1/2 teaspoon cumin seeds; when they turn golden brown, add 1/2 cup finely chopped onion. Sauté until onion turns translucent.\n\n - Add 1/3 cup chopped carrot, 1/3 cup green peas, 1/3 cup chopped green beans and a pinch of salt. Sauté until vegetables turn little soft. It will take around 3-4 minutes over medium flame. Add 1/2 cup chopped boiled potato. \n\n - Mix well and cook for a minute. Add 1/2 teaspoon red chilli powder, a pinch of turmeric powder, a pinch of garam masala powder and 1 teaspoon cumin-coriander powder. Add a pinch of chaat masala powder and 1/3 teaspoon dry mango powder.\n\n - Mix well and cook for a minute. Taste for the seasonings and add more if required. Turn off the flame. Stuffing masala for Veg Puff is ready. Let it cool down to room temperature. \n\n - Follow the instructions given on the box to thaw or defrost the puff pastry sheet. Thaw the pastry sheet to room temperature. Preheat the oven at 425 F (220 C) for 10 minutes. \n\n - Cut thawed sheet into 3 to 4 inch squares as shown in the photo. Put 1-2 tablespoons stuffing in the center of half of the squares. Lightly moisten the edges with a wet brush or finger. Fold each one to give a triangle shape (as shown in the photo). You can also cover it with another square to give it a square shape. Press the edges with hand or a fork. \n\n - Place raw puffs directly on baking tray or a baking tray lined with aluminum foil/butter paper. Place baking tray on the middle rack in preheated oven and bake it at 425 F (220 C) for around 18-20 minutes or until the top surface turns golden brown and crispy. Remove baking tray from oven. '
