  photosArray:['data:image/jpeg;base64,'],
  ingredients: [[22],[0],[1],[10],[29],[42],[43],[44],[45],[6],[54],[55],[48]],
  description: '- Add 3/4 cup maida (all purpose flour), 1 teaspoon oil and salt in a large bowl. Mix all ingredients well and prepare a soft pliable dough (like paratha dough) by adding water as needed. Cover the dough and keep it aside for 20-25 minutes.\n\n - Heat 1 tablespoon oil in a pan over medium flame. Add finely chopped ginger and garlic and sauté for 30 seconds. Add green onion and sauté for a minute.\n\n - Add all chopped veggies (carrot, cabbage, capsicum and green beans) and salt. Mix well and sauté them for 4-5 minutes. Add 1 teaspoon chilli sauce. Add 1/2 -1 teaspoon soy sauce. Add 1/2 teaspoon black pepper powder. Mix well and sauté for a minute. Turn off the flame. Stuffing for Veg Momos is ready.\n\n - Knead the dough again for a minute and divide it into 2-equal portions. Give each portion a round cylindrical shape like cucumber. Cut each one into 6-7 equal portions with a knife as shown in the photo. \n\n - Place one dough pattie on a rolling board and roll it out into a thin disc. Place approx. 1 tablespoon filling in the center. Don’t over-stuff it, otherwise it will be difficult to get a proper “potli” shape. \n\n - Grease a steamer plate or any other plate (it should easily fit into the steamer or a deep vessel) with oil to prevent them sticking. Heat 1-2 glass of water in a steamer or a deep vessel over medium flame. \n\n - Place stand in the steamer and place momos plate over it. Momos should not touch the water. Cover the steamer/vessel with a lid and steam them for 6-7 minutes over medium flame or until they look little translucent and shiny. Remove the lid and check them by touching it'
