  description: '- Boil approx. 6 cups water in a large pot/pan over medium flame. Add raw pasta, 1 teaspoon oil and salt (approx. 1 teaspoon). Stir well and let them boil until pastas are al dente (cooked but not very soft). It will take around 10-12 minutes. Stir in between occasionally to prevent sticking. \n\n - Blanch the tomatoes and make tomato puree. Heat 2-tablespoons olive oil in a deep saucepan over medium heat. If possible, use deep saucepan because sauce will splatter while cooking at later stage. Add chopped onion and chopped garlic.\n\n - Pour in prepared tomato puree and a piece of carrot. Carrot is added to reduce the sour taste. Add red pepper flakes, dried basil and dried oregano. Add ground black pepper, sugar and salt. \n\n - Add cooked pasta and mix well. Cook for 2-3 minutes. Turn off the flame. Tomato Pasta is now ready. Garnish with grated Parmesan cheese or feta cheese or grated mozzarella cheese.'
