  ingredients: [[10],[29],[44],[43],[42],[45],[41],[40],[48],[54],[0],[1],[22]],
  description: '- Boil the noodles as per the instructions given on the backside of the noodles pack.Heat 2-teaspoons oil in a broad pan over high flame. Add finely chopped ginger-garlic and sauté for 10 seconds. Add white part of spring onion and sauté for 30-40 seconds. \n\n - Add capsicum, carrot, cabbage and french beans. Sauté for 3-4 minutes. Add green part of spring onion. Add boiled noodles and black pepper powder. Add soy sauce and salt. Mix well and sauté them for 2 minutes. Turn off flame. Stuffing is ready. \n\n - Dissolve 2 tablespoons maida in 2-3 tablespoons water to make a smooth and medium thick paste. Follow the instructions given on the wrapper package to separate the sheets. If you are using frozen wrappers, defrost them first and then cover with a damp towel for 2-3 minutes. So the wrapper will come out easily.\n\n - Take one wrapper sheet and place it on a plate or on chopping board. Place 1½-2 tablespoons stuffing at the bottom corner. Keep 1-inch space from sides. Apply little maida paste on the edges using your fingertip or brush.\n\n - Cover the stuffing by folding. Heat oil in a pan or kadai over medium flame. When oil is medium hot, place 3-4 prepared rolls at a time (more or less depending on the size of the pan) in oil and deep fry until light golden brown and crispy.'
