  photosArray:['data:image/jpeg;base64,'],
  ingredients: [[64],[65],[8],[31],[14],[15],[0],[1],[66],[6],[25],[44],[38]],
  description: '- Prepare the batter. Pour 1-2 glasses water in a wide and deep pan or in a dhokla/idli steamer and place it on the stovetop over medium flame. Place a stand inside it (if the mould has the attached base stand, no need to place the stand). Grease the idli mould with oil.\n\n - Pour batter into each mould using a spoon. Place the idli stand inside the pan/steamer. Cover the pan with a lid and steam it over medium flame for 7-8 minutes. Let it cool for 3-4 minutes. Remove them using a spoon. They will come out easily. \n\n - Prepare Tamarind Juice – soak 1/2 tablespoon tamarind in 3-tablespoons of hot water for 10-15 minutes, mash it with a spoon and strain it using a sieve and discard the solids.\n\n - Add toor dal, turmeric powder and 1 cup water in 3-4 liters capacity steel or aluminum pressure cooker. Add mixed vegetables in a small container, place it inside the pressure cooker and close the cooker lid. Pressure cook over medium flame for 3-4 whistles. For this recipe we used 1/4 cup potato, 1/4 cup brinjal, 1/4 cup carrot and 1/4 cup French beans as mixed vegetables. \n\n - Heat 1-tablespoon oil in a pan or kadai over medium flame. Add mustard seeds. When they start to splutter, add curry leaves, dry red chilies, asafoetida, and sauté for 10-15 seconds. Add chopped onion. Sauté until onion turns transparent. Add tamarind juice and cook for 2-3 minutes. \n\n - Add chopped tomatoes. Sauté until tomatoes turn soft. Add Sambar Powder. Stir and cook for a minute. Add cooked and mashed dal, boiled vegetables, 1½ cups water and salt. \n\n - Mix well and boil until it turns frothy; it will take around 5-7 minutes. Turn off the flame. Transfer spicy Sambar into a serving bowl and garnish with finely chopped coriander leaves.'
