  ingredients: [[2],[52],[6],[25],[10],[29],[42],[44],[43],[11],[14],[15],[31],[62],[0],[1],[8],[3],[33]],
  description: '- Transfer chopped potato, cauliflower, carrot and green peas into a 2-3 liter capacity pressure cooker. Add 1/2 cup water and salt to taste. Close the pressure cooker with a lid and cook over medium flame for 2-whistles. Turn off the flame. Open the lid after pressure releases naturally; it will take around 5-7 minutes.\n\n- Mash the boiled vegetables gently with potato masher or using the backside of a large spoon until little chunky texture. You can mash cooked veggies into a texture you like – with small chunks or smooth with no chunks at all. The texture of your bhaji would depend on how you mashed the veggies.\n\n - Heat 2-tablespoons oil and 2-tablespoons butter together in a pan over medium flame. Add chopped onion and ginger-garlic paste. Sauté until onion turns translucent. Add chopped capsicum, chopped tomato and salt. Sauté until tomatoes and capsicum turn soft.\n\n - Add 1½ teaspoons red chilli powder, 1/4 teaspoon turmeric powder, 1-teaspoon cumin-coriander powder and 1-teaspoon readymade pav bhaji masala powder. Stir and cook for a minute. Add 3/4 cup water, mix well and cook for 2-3 minutes.\n\n -  Add boiled and mashed vegetables and 1-teaspoon lemon juice. Mix well and cook for 4-5 minutes. Taste for the salt at this stage and add more if required. Turn off the flame. Add chopped coriander leaves and mix well. Bhaji is ready for serving.\n\n - Cut the pav buns horizontally into halves. Heat tava over medium flame. Add a tablespoon of butter and place halved pav buns over it. Shallow fry both sides until light brown spots appear, it will take around 30 seconds for each side to turn light brown.'
