  photosArray:['data:image/jpeg;base64,'],
  ingredients: [[67],[68],[69],[70],[71],[72],[73],[12],[33],[35]],
  description: '- Remove crust of bread and cut into 1-inch cubes.Preheat oven at 350 °F and grease 9 x 5 x 3 inch ovenproof loaf pan with butter.Heat milk and heavy cream on medium heat in a medium saucepan. When it comes to boil, remove pan from heat and stir well. Let it cool at room temperature.\n\n - Place bread cubes in a large bowl and pour prepared milk and cream mixture over it. Toss bread cubes gently to allow them absorb the liquid. Let it rest for 15 minutes.\n\n - Whisk together lightly beaten eggs, sugar, ground cinnamon and vanilla extract in a mixing bowl, add mashed banana and mix well. Pour banana-egg mixture over soaked bread cubes in a bowl and gently combine. Transfer prepared mixture to greased loaf pan and sprinkle some raisins over it.\n\n - Place a loaf pan in large metal baking pan in oven. Pour warm water in large pan until it reaches halfway to the sides of loaf pan. Bake in preheated oven for an hour or until pudding is set. (Verify by inserting and removing knife in the center of it, knife should come out clean.) Take it out from the oven and allow it to cool for 15 minutes. Serve warm banana and bread pudding with vanilla ice cream.'
