  ingredients: [[78],[70],[35],[74],[75],[76],[72],[77],[12]],
  description: '- To grate the dudhi, first peel it and then wash it in running water. After that, grate it from all sides and discard center part having seeds. Squeeze out water from grated dudhi completely.\n\n - Heat ghee in a pan over medium flame. Add grated dudhi. Sauté it for 3-4 minutes, stirring continuously. Add milk and condensed milk; mix well and bring mixture to a boil.\n\n - When it starts boiling, reduce flame to low and cook it until almost milk is absorbed. It will take approx. 10-15 minutes. Stir occasionally in between to prevent sticking. Add sugar, chopped cashew nuts, raisins and chopped almonds.\n\n - Stir continuously and cook until almost moisture is evaporated and mixture turns thick; approx. 3-4 minutes. Turn off the flame, add cardamom powder and mix it properly.'
